import axios from 'axios'

const instance = axios.create(
    {
        baseURL: 'https://localhost:500/',
        timeout: 15000,
        headers:{
            'Content-Type':'application/json'
        }
    }
)

export const parse = async(value) =>{
    const { data } = await instance.post("/parse", { peticion: value })
    return data
}
